'use strict';
//@@DocInclude
//@@DocBrief("The class provides information for a stop/limit order request")
class BaseSLOrderRequest {
    rate;
    pips;
    tradeId;
    orderId;
    customId;
    constructor() {
        this.tradeId = "";
        this.rate = 0.0;
        this.pips = 0.0;
        this.customId = "";
        this.orderId = "";
    }
    getRate() {
        return this.rate;
    }
    getPips() {
        return this.pips;
    }
    getTradeId() {
        return this.tradeId;
    }
    getOrderId() {
        return this.orderId;
    }
    getCustomId() {
        return this.customId;
    }
}
module.exports = BaseSLOrderRequest
